import React from "react";
import { Route, Routes } from 'react-router-dom';
import Header from "./components/header/header";
import Page from "./pages/page";

function App() {
  return (
    <div className="wrapper">
      <Header />
      <Routes>
        <Route path=""/>
      </Routes>
      <Page img='images/1.jpg' title='Модель 01'/>
    </div>
  );
}

export default App;
